import React from "react";
import Nav from "../Nav";
import "./contact.css";
import twitter from "..images/twitter.png";
// import insta from "..images/"
// import face from "..images/"

const Contact = () => {
  return (
    <div>
      <Nav></Nav>

      <div className="restcontact">
        <div className="contactcard">
            <h1>
            REACH US AT
            </h1>
            <h2>support@kicksup.com</h2>
            <p>for any technical support</p>
            <h2>info@kicksup.com</h2>
            <p>for more information</p>
            <h2>feedback@kicksup.com</h2>
            <p>to send your feedback</p>
            <h2>jobs@kicksup.com</h2>
            <p>to work with us</p>
        </div>
        <div className="contactlink">
            <p>stay in touch</p>
            <div className="linkicons">
                <img src="" className="imageicon" alt=""></img>
                <img src="" className="imageicon" alt=""></img>
                <img src="" className="imageicon" alt=""></img>

            </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
